const initState = {
    authERROR: null
}
  const dataReducer = (state = initState, action) => {
    switch (action.type) {
      case 'GET_DATA':
        return {...state ,  authERROR: null}
      case 'DATA_ERROR':
        return state
      default:
        return state;
    }
  };

  export default dataReducer;
